        id: 22,
        linkImgThree: "../../../images/mdThree.webp"
      },
      {
        id: 23,
        linkImgFour: "../../../images/mdTwo.webp"
      }
    ]
  };

  render() {
    return (
      <div>
        {this.state.myProfilImg.map(me => {
          if (<Portfolio /> === me.linkImgTwo) {
            return (
              <img
                key={me.id}
                src={me.linkImgOne}
                className="card-img-top "
                alt="..."
              />
            );
          }
        })}
      </div>
    );
  }
}

export default Img;
